import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the cart element using text content
    await page.waitForSelector('div.cart:has-text("Cart")', { timeout: 5000 });
    await page.click('div.cart:has-text("Cart")');

    // Wait for cart modal to appear and take screenshot
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Verify modal is open by checking for checkout button
    const checkoutText = await page.textContent('.checkout-btn');
    const cartItems = await page.$$eval('.cart-item', items => items.length);

    return {
      success: true,
      action: "Successfully opened shopping cart modal",
      extractedData: {
        checkoutButtonText: checkoutText,
        cartItemCount: cartItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
